import React from 'react'
import Home from './../Pages/Home';
import Login from './../Pages/Login';
import Test from './../Pages/Test';
import PageNotFound from './../Pages/PageNotFound'
import { Route, Switch } from 'react-router-dom'

function Routing(){
    return(
        <React.Fragment>
            <Switch>
                <Route exact path='/' component={ Home } />
                <Route exact path='/about' component={ function(){ return( <h1>About</h1> ) }  } />
                <Route exact path='/packages' component={ function(){ return( <h1>Package</h1> ) }  } />
                <Route exact path='/clients' component={ function(){ return( <h1>Our Client</h1> ) }  } />
                <Route exact path='/career' component={ function(){ return( <h1>Career</h1> ) }  } />
                <Route exact path='/login' component={ Login } />
                <Route exact path='/test' component={ Test } />

                <Route component={ function(){ return( <h1>Page Not Found</h1> ) } } />

            </Switch>
        </React.Fragment>
    )
}

export default Routing
